import React from "react";
import img1 from '../assets/personal1.png';
import '../stylesX/Personal.css';

function Personal() {
    return (
        <>
        <div className="card">
            <div className="imgBox">
                <img src={img1} width='100%' height='100%'/>
            </div>
            <div className="cardBox">
                <h3 className="cardTitle">Free Checking</h3>
                No hidden fees, no minimum balance!
                <br/><br/>
                Get started with every convenience you need from a checking account. The Bankers gives you a solid financial foundation including a The Bankers Visa® Debit Card, free banking with online bill pay, eStatements, and mobile banking with checking deposits. You can also choose from Apple Pay®, Google Pay®, and Samsung Pay™.
            </div>
        </div>
        
        <div className="clearBoth"></div>
        </>
    )
}

export default Personal;
